pragma solidity 0.5.14;

import "openzeppelin-solidity/contracts/token/ERC20/IERC20.sol";


contract IDao {

    function vote(
        uint256 proposalId,
        uint8 voteType, 
        uint256 votes
    ) external;
}

contract VoteReentracyTest {
    IDao private target;
    IERC20 private _token;
    uint256 private _proposalId;
    uint8 private _voteType;
    uint256 private _votes;

    function() external {
        _token.approve(address(target), _votes);
        target.vote(_proposalId, _voteType, _votes);
    }

    function vote(
        address dao,
        address token,
        uint256 proposalId,
        uint8 voteType, 
        uint256 votes
    ) 
        external
    {
        target = IDao(dao);
        _token = IERC20(token);
        _proposalId = proposalId;
        _voteType = voteType;
        _votes = votes;

        _token.approve(address(target), _votes);
        target.vote(_proposalId, _voteType, _votes);

        (bool success, ) = address(this).call("");

        if (!success) {
            revert("REENTRANT_CALL");
        }
    }
}
